    backgroundSize: 'cover',
    backgroundRepeat: 'no-repeat',
    fontFamily: 'Helvetica',
    opacity: '0.9'
}

class LandingPage extends React.Component {
    render() {
        return (
            <div>
                <button>
                    <Link href="/dealer">
                        <a>Dealer</a>
                    </Link>
                </button>
                <button>
                    <Link href="/customer">
